def custom_prime_factorial(a, b, c, d, e):

    def is_prime(n):
        if n <= 1:
            return False
        if n == 2:
            return True
        if n % 2 == 0:
            return False
        sqr = int(n ** 0.5) + 1
        for divisor in range(3, sqr, 2):
            if n % divisor == 0:
                return False
        return True

    def factorial(n):
        if n == 0:
            return 1
        else:
            return n * factorial(n - 1)
    if a > b and a < 1 and (b < 1) and (c < 1) and (d < 1) and (e < 1):
        return -1
    ListA = [x for x in range(a, b + 1) if is_prime(x) and x % c != 0]
    ListB = [factorial(x) * e for x in ListA]
    ListB.sort()
    if len(ListB) < d or d <= 0:
        return -1
    return ListB[d - 1]

